/** @jsxImportSource @emotion/react */
import { FC } from 'react';

interface IBodyProps extends React.HTMLAttributes<HTMLDivElement> {
  tabId: string,
  currentTab: string,
};

const Body: FC<IBodyProps> = ({ children, currentTab, tabId }) => {
  return (
    <div>
      {children}
    </div>
  )
};

export default Body;
